import React from "react";
import "./C";

export default function CircleStatic({ size = 160, color = "#000" }) {
  const radius = Math.round(size * 0.28); // distance of outer dots
  const styleObj = {
    width: `${size}px`,
    height: `${size}px`,
    ["--dot-color"]: color,
    ["--radius"]: `${radius}px`,
  };

  return (
    <div className="circle-static" style={styleObj}>
      {/* 8 outer dots */}
      {[...Array(8)].map((_, i) => (
        <div key={i} className={`outer pos${i + 1}`}>
          <div className="dot" />
        </div>
      ))}

      {/* center dot */}
      <div className="center">
        <div className="dot center-dot" />
      </div>
    </div>
  );
}
